function Cart(props) {
  return (
    <div>
      <tr>
              <td>{props.title}</td>
              <td>{props.cost}</td>
            <td>
              <button type="text">-</button>
              {props.quantity}<button type="text">+</button></td>
            <td>{props.cost*props.quantity}</td>
              <td><button className="delete-into-card" data-key={props.title}>X</button></td>
           </tr>
    </div>
  )
}
export default Cart;
